import React from "react";
import logo from "./logo.svg";
import "./App.scss";

function App() {
    function Test() {
        return <h2 class="test">Hello</h2>;
    }
    return (
        <div className="App">
            <header className="App-header"></header>
            <p>{Test()}</p>
        </div>
    );
}

export default App;
